import React from "react";
import PostItem from "./posts";

export default function PostList({posts}) {
    return(
        <div>
            <h1></h1>
            {posts.map(
                (post)=>{
                    <PostItem title={post.title} body={post.body}/>
                }
            )
            }
        </div>
    )
}
